import React, { Component } from 'react';

const MyInfo = () => {
    return (
        <div>
            <h1>Suraj Shrestha</h1>
            <p>Hello from me !!</p>
            <ul>
                <li>Japan</li>
                <li>Indonesia</li>
                <li>Thailand</li>
            </ul>
        </div>
    )
}

export default MyInfo;
